import React, { useContext } from "react";
import { NavLink } from "react-router-dom";
import { AuthContext } from "../context/authContext"; // Assurez-vous d'importer avec le bon nom
import "./styles/navbar.css";

const Navbar = () => {
  const { user, logout } = useContext(AuthContext); // Utilisez le contexte avec le bon nom

  console.log(user); // Ajoutez ce console.log pour vérifier les informations sur l'utilisateur

  const handleLogout = () => {
    logout(); // Appel de la fonction logout
  };

  return (
    <header className="header">
      <nav className="nav container">
        <NavLink to="/" className="nav__logo">
          Navigation Bar
        </NavLink>
        <ul className="nav__list">
          {user.logged && ( // Utilisez user.logged pour vérifier si l'utilisateur est connecté
            <>
              <li>
                <NavLink to="/home" className="nav__link">
                  Home
                </NavLink>
              </li>
              <li>
                <NavLink to="/profile" className="nav__link">
                  Profile
                </NavLink>
              </li>
              <li>
                <button className="nav__link" onClick={handleLogout}>
                  Logout
                </button>
              </li>
            </>
          )}
        </ul>
      </nav>
    </header>
  );
};

export default Navbar;
